import Topics from '../components/Topics';
import Posts from './Posts';
import { Grid } from 'semantic-ui-react';

export default function Home(){
    return (
        <Grid>
            <Grid.Row>
                <Grid.Column width={3}>
                    <Topics />
                </Grid.Column>
                <Grid.Column width={10}>
                    <Posts/>
                </Grid.Column>
                <Grid.Column width={3}>
                    留白
                </Grid.Column>
            </Grid.Row>

        </Grid>
    )
}
